g some AH mail<br />* [Retail] Optimized item-based scans (Auctioning and some Shopping scans)<br />* [Retail] Fixed issue with cancel scan incorrectly showing an auction as undercut immediately after posting<br />* [Retail] Fixed issue with cancel scan incorrectly showing auctions as undercut by the player<br />* [Retail] Fixed issue with auction order in the various auction table UIs<br />* [Retail] Fixed issue with default stack size when posting via Shopping<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1579212789,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-15-changelog/"},{title="TradeSkillMaster v4.9.14 Changelog",content="TSM v4.9.14 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Classic] Fixed issue with auction selection.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1579134857,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-14-changelog/"},{title="TradeSkillMaster v4.9.13 Changelog",content="TSM v4.9.13 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may